import React from "react";
import "./IlkOnbir.css";

import Field from "./6201908281734.jpg";
import Altay from './altay-fb1.jpeg';
import Serdar from './SerdarAziz.jpeg';
import Simon from './Simon Falette.jpg';
import Nabil from './Nabil Dirar.jpeg';
import Hasan from './Hasan Ali Kaldirim.jpeg'


export default function IlkOnbir() {
  return (
    <div className="container">
      <div className="players">

        <div className="eachPlayer">
          <div className="playerPic"><img src={Altay} alt=""/></div>  
          <p>Altay Bayindir</p>
        </div>
        <div className="eachPlayer">
          <div className="playerPic"><img src={Serdar} alt=""/></div>  
          <p>Serdar Aziz</p>
        </div>
        <div className="eachPlayer">
          <div className="playerPic"><img src={Simon} alt=""/></div>  
          <p>Simon Falette</p>
        </div>
        <div className="eachPlayer">
          <div className="playerPic"><img src={Nabil} alt=""/></div>  
          <p>Nabil Dirar</p>
        </div>
        <div className="eachPlayer">
          <div className="playerPic"><img src={Hasan} alt=""/></div>  
          <p>Hasan Ali Kaldirim</p>
        </div>

      </div>
      <div className="field">
        <img src={Field} alt="field-img" />
      </div>
      <div className="players"></div>
    </div>
  );
}
